    SimpleBrowser App is simple browser like his name , User can use it for do some simple tasks like (Browsing by either ready sites links in HomeTabNavigation or by WebPage in SearchTabNavigation , Save all your activities on app in three tabs in History section : BrowsingHistory that save all browsing activities and SearchHistory that save all search web history in app and MyFavourite that save your sites and apps favourite and all of them be displayed in History Section . also you be able to change configurations on app like (Language (English or Arabic), App Mode(Light or Dark), Font Size to all apps and change search engine (google,bing,yahoo,etc...) and finally we thank you if share our app on social media by press on ShareApp link in last page ... enjoy in our app and good luck :)
